import { IoIosMenu } from "react-icons/io";

const Header = () => {
    return (
        <div className="header__wrapper">
            <div className="header">
                {/* <img src={menu} className='menu_button'/> */}
                <p className='menu_button'><IoIosMenu size={30} color='white'/></p>
                <p className="branding">ИСКУССТВО ЖИТЬ</p>
                <p className="branding"><b>angel.</b><br/>даст</p>
            </div>
        </div>
    );
}

export default Header;
